/*Table structure for table `pf_gmuni_resource` */

DROP TABLE IF EXISTS `pf_gmuni_resource`;

CREATE TABLE `pf_gmuni_resource` (
  `id` varchar(50) COLLATE utf8_bin NOT NULL COMMENT '主键',
  `name` varchar(50) COLLATE utf8_bin NOT NULL COMMENT '资源名称',
  `type` char(10) COLLATE utf8_bin NOT NULL COMMENT '资源类型 0:目录 1:菜单 2:按钮',
  `url` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '如果是菜单，需要添加菜单路径',
  `button_code` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '如果是按钮，需要添加按钮编码',
  `parent_id` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '资源父id',
  `code` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '资源编码，所有资源编码必须唯一',
  `parent_code` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '资源对应的父资源编码',
  `create_time` datetime DEFAULT NULL COMMENT '添加时间',
  `status` varchar(10) COLLATE utf8_bin DEFAULT '1' COMMENT '状态0：禁用，1:启用',
  `sort` decimal(10,0) DEFAULT NULL COMMENT '排序号',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

