/*Table structure for table `sc_gmuni_lost_found` */

DROP TABLE IF EXISTS `sc_gmuni_lost_found`;

CREATE TABLE `sc_gmuni_lost_found` (
  `id` varchar(32) COLLATE utf8_bin NOT NULL COMMENT 'id',
  `title` varchar(500) COLLATE utf8_bin DEFAULT NULL COMMENT '标题',
  `obj_name` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '物品名称',
  `obj_address` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '地点',
  `obj_time` datetime DEFAULT NULL COMMENT '时间',
  `description` varchar(1000) COLLATE utf8_bin DEFAULT NULL COMMENT '详细描述',
  `user_info` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '提交用户',
  `campus` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '所属学校',
  `create_time` datetime DEFAULT NULL COMMENT '信息提交时间',
  `lf_type` varchar(10) COLLATE utf8_bin DEFAULT NULL COMMENT '类型{0：丢失，1：捡到}',
  `info_status` varchar(10) COLLATE utf8_bin DEFAULT NULL COMMENT '状态{0：激活，1：完结}',
  `snapshot` longtext COLLATE utf8_bin COMMENT '缩略图',
  `image` longtext COLLATE utf8_bin COMMENT '大图',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

