/*Table structure for table `zs_gmuni_yearly_score` */

DROP TABLE IF EXISTS `zs_gmuni_yearly_score`;

CREATE TABLE `zs_gmuni_yearly_score` (
  `id` varchar(50) COLLATE utf8_bin NOT NULL COMMENT '主键',
  `year` varchar(4) COLLATE utf8_bin DEFAULT NULL COMMENT '年份',
  `provinces` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '省份 ',
  `batch` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '批次：一批二批 ',
  `family` varchar(300) COLLATE utf8_bin DEFAULT NULL COMMENT '科类：文、理、艺、体',
  `scoreline` decimal(10,1) DEFAULT NULL COMMENT '分数线',
  `max_score` decimal(10,1) DEFAULT NULL COMMENT '最高分',
  `min_score` decimal(10,1) DEFAULT NULL COMMENT '最低分',
  `avg_score` decimal(10,1) DEFAULT NULL COMMENT '平均分',
  `sort` varchar(10) COLLATE utf8_bin DEFAULT NULL COMMENT '排序号',
  `pro_course` varchar(300) COLLATE utf8_bin DEFAULT NULL COMMENT '预留:专业课',
  PRIMARY KEY (`id`),
  KEY `yealy_index` (`provinces`,`year`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

